import React, { useEffect, useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";

export default function App() {
  const [users, setUsers] = useState([]);
  const [license, setLicense] = useState(null);
  const [search, setSearch] = useState("");
  const [groups, setGroups] = useState([]);
  const [selectedGroupUsers, setSelectedGroupUsers] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3001/users.list")
      .then((res) => res.json())
      .then((data) => setUsers(data.users));

    fetch("http://localhost:3001/license.info")
      .then((res) => res.json())
      .then((data) => setLicense(data.license));

    fetch("http://localhost:3001/groups.list")
      .then((res) => res.json())
      .then((data) => setGroups(data.groups));
  }, []);

  const handleGroupClick = (id) => {
    fetch(`http://localhost:3001/groups.users?id=${id}`)
      .then((res) => res.json())
      .then((data) => setSelectedGroupUsers(data.users));
  };

  const filteredUsers = users.filter(
    (user) =>
      user.name.toLowerCase().includes(search.toLowerCase()) ||
      user.email.toLowerCase().includes(search.toLowerCase())
  );

  return (
    <div className="container py-4">
      <h1 className="mb-4">Slack Mock Dashboard</h1>

      <div className="row">
        <div className="col-md-6 mb-4">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">License Info</h5>
              {license && (
                <ul>
                  <li>Type: {license.type}</li>
                  <li>Status: {license.status}</li>
                  <li>
                    Users: {license.current_users}/{license.max_users}
                  </li>
                  <li>Billing: {license.billing_cycle}</li>
                </ul>
              )}
            </div>
          </div>
        </div>

        <div className="col-md-6 mb-4">
          <div className="card">
            <div className="card-body">
              <h5 className="card-title">Groups</h5>
              <ul className="list-group">
                {groups.map((group) => (
                  <li
                    key={group.id}
                    className="list-group-item"
                    onClick={() => handleGroupClick(group.id)}
                    style={{ cursor: "pointer" }}
                  >
                    {group.name}
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      </div>

      <input
        className="form-control mb-3"
        placeholder="Search users"
        value={search}
        onChange={(e) => setSearch(e.target.value)}
      />

      <div className="card mb-4">
        <div className="card-body">
          <h5 className="card-title">All Users</h5>
          <ul className="list-group">
            {filteredUsers.map((user) => (
              <li key={user.id} className="list-group-item">
                {user.name} - {user.email}
              </li>
            ))}
          </ul>
        </div>
      </div>

      {selectedGroupUsers.length > 0 && (
        <div className="card mb-4">
          <div className="card-body">
            <h5 className="card-title">Group Users</h5>
            <ul className="list-group">
              {selectedGroupUsers.map((user) => (
                <li key={user.id} className="list-group-item">
                  {user.name} - {user.email}
                </li>
              ))}
            </ul>
          </div>
        </div>
      )}
    </div>
  );
}
